import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

function MyFooter() {
  return (
    <Navbar className='footer' fixed="bottom" collapseOnSelect expand="lg" bg="secondary" variant="dark">
      <Container fluid>
        <div>
        <i class="bi bi-facebook"></i>
        </div>
      </Container>
    </Navbar>
  );
}

export default MyFooter;
